  'txtAboutAppAns3': "ಹೌದು. ನಿಮ್ಮ ವ್ಯಾಯಾಮದ ಮೊದಲು ಅಭ್ಯಾಸ ಮುಖ್ಯ. ಗಾಯಗಳನ್ನು ಕಡಿಮೆ ಮಾಡಲು ಮತ್ತು ನಿಮ್ಮ ತಾಲೀಮು ಕಾರ್ಯಕ್ಷಮತೆಯನ್ನು ಸುಧಾರಿಸಲು ಇದು ನಿಮಗೆ ಸಹಾಯ ಮಾಡುತ್ತದೆ. The n ತಾಲೀಮು ನಂತರ ಕೆಳಗಿಳಿಯುವುದು ಸಹ ಅಗತ್ಯವಾಗಿದೆ, ಏಕೆಂದರೆ ಇದು ನಿಮ್ಮ ದೇಹವು ಅದರ ಸಾಮಾನ್ಯ ಸ್ಥಿತಿಗೆ ಮರಳಲು ಸಹಾಯ ಮಾಡುತ್ತದೆ ಮತ್ತು ಸ್ನಾಯು ನೋವಿನ ಅವಕಾಶವನ್ನು ಕಡಿಮೆ ಮಾಡುತ್ತದೆ.",
  'txtAboutWorkoutAns1': "ವ್ಯಾಯಾಮದ ಸಮಯದಲ್ಲಿ ಯಾವುದೇ ಅಸ್ವಸ್ಥತೆ ಸಂಭವಿಸಿದಲ್ಲಿ, ದಯವಿಟ್ಟು ತಕ್ಷಣ ವ್ಯಾಯಾಮ ಮಾಡುವುದನ್ನು ನಿಲ್ಲಿಸಿ ಮತ್ತು ವೈದ್ಯರ ಬಳಿಗೆ ಹೋಗಿ.",
  'txtAboutWorkoutAns2': "ಒಳ್ಳೆಯ ಕೆಲಸ! ನಿಮ್ಮ ಫಲಿತಾಂಶಗಳನ್ನು ಬಲಪಡಿಸಲು ನೀವು 30 ದಿನಗಳ ರೈಲು-ಇಂಗ್ ಅನ್ನು ಪುನರಾವರ್ತಿಸಬಹುದು, ಅಥವಾ ಯೋಜನೆ ಪುಟದಲ್ಲಿ ನಿಮಗೆ ಆಸಕ್ತಿಯಿರುವ ಹೆಚ್ಚಿನ ತರಬೇತಿಯನ್ನು ಕಂಡುಕೊಳ್ಳಬಹುದು.",
  'txtAboutWorkoutAns3': "ಈ ಅಪ್ಲಿಕೇಶನ್ ನಿಮಗೆ ಸುರಕ್ಷಿತವಾಗಿ ತೂಕ ಇಳಿಸಿಕೊಳ್ಳಲು ಸಹಾಯ ಮಾಡುತ್ತದೆ. ನೀವು ರಾತ್ರಿಯಿಡೀ ತೂಕವನ್ನು ಕಳೆದುಕೊಳ್ಳಲು ಸಾಧ್ಯವಿಲ್ಲ.\n\nsince ತೂಕವನ್ನು ಕಳೆದುಕೊಳ್ಳುವುದು ದೀರ್ಘಾವಧಿಯ ಪ್ರಕ್ರಿಯೆಯಾಗಿದೆ, ನೀವು ಅದಕ್ಕೆ ಅಂಟಿಕೊಳ್ಳಬೇಕು",
  'txtAboutPaymentAns1': "1. ನಿಮ್ಮ ಹೊಸ ಸಾಧನದಲ್ಲಿನ ಅಪ್ಲಿಕೇಶನ್ ಅನ್ನು ಗೂಗಲ್ ಪ್ಲೇನಿಂದ ಡೌನ್‌ಲೋಡ್ ಮಾಡಲಾಗಿದೆ ಎಂದು ಖಚಿತಪಡಿಸಿಕೊಳ್ಳಿ.\n\n2. ಗೂಗಲ್ ಪ್ಲೇನಲ್ಲಿ ನೀವು ಬಳಸುತ್ತಿರುವ ಖಾತೆಯು ನೀವು ಚಂದಾದಾರರಾಗಲು ಬಳಸಿದಂತೆಯೇ ಇದೆ ಎಂದು ಖಚಿತಪಡಿಸಿಕೊಳ್ಳಿ.\n\n3. ಅಪ್ಲಿಕೇಶನ್ ಅನ್ನು ಮರುಪ್ರಾರಂಭಿಸಿ, ಅದು ನಿಮ್ಮ ಪ್ರೀಮಿಯಂ ಆವೃತ್ತಿಗೆ ಸ್ವಯಂಚಾಲಿತವಾಗಿ ಹಿಂತಿರುಗುತ್ತದೆ.",
  'txtAboutPaymentAns2': "Google Play -v ಚಂದಾದಾರಿಕೆಗಳು -> ಮಹಿಳೆಯರಿಗಾಗಿ ತೂಕವನ್ನು ಕಳೆದುಕೊಳ್ಳಿ -> ಚಂದಾದಾರಿಕೆಯನ್ನು ರದ್ದುಗೊಳಿಸಿ",
  'txtAboutPaymentAns3': "ನೀವು ಚಂದಾದಾರಿಕೆಯನ್ನು ರದ್ದುಗೊಳಿಸದಿದ್ದರೆ, ಪ್ರಸ್ತುತ ಅವಧಿ ಮುಗಿಯುವ 24 ಗಂಟೆಗಳ ಮೊದಲು ನಿಮ್ಮ ಎಸಿ-ಎಣಿಕೆ ನವೀಕರಣಕ್ಕಾಗಿ ವಿಧಿಸಲಾಗುತ್ತದೆ.\n\nplease ನಿಮ್ಮ ಚಂದಾದಾರಿಕೆ ಸ್ಥಿತಿಯನ್ನು ಕಂಡುಹಿಡಿಯಲು ಪ್ಲೇ ಸ್ಟೋರ್‌ನ ಚಂದಾದಾರಿಕೆ ಪುಟವನ್ನು ಪರಿಶೀಲಿಸಿ.",
  'txtAboutPaymentAns4': "Google Play ಮೂಲಕ ಮಾಡಿದ ಎಲ್ಲಾ ಪಾವತಿಗಳನ್ನು Google ನಿಂದ ನಿಯಂತ್ರಿಸಲಾಗುತ್ತದೆ ಮತ್ತು ನಿರ್ವಹಿಸಲಾಗುತ್ತದೆ.\n\nif ನೀವು ಚಂದಾದಾರಿಕೆಯನ್ನು ರದ್ದುಗೊಳಿಸಲು ಅಥವಾ ತಪ್ಪಾಗಿ ಚಂದಾದಾರರಾಗಲು ಮರೆತಿದ್ದೀರಿ, ದಯವಿಟ್ಟು ಹೆಚ್ಚಿನ ಮಾಹಿತಿಗಾಗಿ Google Play ಅನ್ನು ಸಂಪರ್ಕಿಸಿ.",
  'txtAboutPaymentAns5': "ನೀವು ಅಪ್ಲಿಕೇಶನ್ ಅನ್ನು ಅಸ್ಥಾಪಿಸಿದ್ದರೆ, ಆದರೆ ಚಂದಾದಾರಿಕೆಯನ್ನು ರದ್ದುಗೊಳಿಸದಿದ್ದರೆ, ನಿಮ್ಮ ಖಾತೆಯನ್ನು ಇನ್ನೂ Google Play ವಿಧಿಸಲಾಗುತ್ತದೆ.",
