  'ex_desc_242': "ನಿಮ್ಮ ಮೊಣಕಾಲುಗಳು ಬಾಗಿದ ಮತ್ತು ನಿಮ್ಮ ಪಾದಗಳನ್ನು ಸಮತಟ್ಟಾಗಿ ಕುಳಿತುಕೊಳ್ಳಿ.\n\nನಿಮ್ಮ ಕೈಗಳನ್ನು ನಿಮ್ಮ ಹಿಂದೆ ನೆಲದ ಮೇಲೆ ತಿರುಗಿಸಿ, ಮತ್ತು ನಿಮ್ಮ ಬೆರಳುಗಳು ಹಿಂದಕ್ಕೆ ತೋರಿಸುತ್ತವೆ. ನಿಮ್ಮ ಭುಜಗಳು.",
  'ex_desc_243': "ನಿಮ್ಮ ಕಾಲುಗಳು ನಿಮ್ಮ ಬದಿಗಳಲ್ಲಿ ವಿಸ್ತರಿಸಿ ಮತ್ತು ತೋಳುಗಳನ್ನು ಹೊಂದಿರುವ ಸುಳ್ಳು ಸ್ಥಾನದಲ್ಲಿ ಪ್ರಾರಂಭಿಸಿ.\n\nsimultianys ಆಗಿ ನಿಮ್ಮ ಎಡಗಾಲನ್ನು ಮತ್ತು ನಿಮ್ಮ ಮೇಲಿನ ದೇಹವನ್ನು ನೆಲದಿಂದ ಮೇಲಕ್ಕೆತ್ತಿ, ಮತ್ತು ನಿಮ್ಮ ಕಾಲ್ಬೆರಳುಗಳನ್ನು ಸ್ಪರ್ಶಿಸಲು ನಿಮ್ಮ ಬಲಗೈ ಬಳಸಿ. ಇತರ ಕಾಲಿನಿಂದ ಪುನರಾವರ್ತಿಸಿ.",
  'ex_desc_244': "ನಿಮ್ಮ ಬದಿಗಳಲ್ಲಿ ನೆಲದ ಮೇಲೆ ನಿಮ್ಮ ಸೊಂಟದ ಹಿಂದೆ ನಿಮ್ಮ ಅಂಗೈಗಳೊಂದಿಗೆ ಕುಳಿತುಕೊಳ್ಳಿ.\n\nನಿಮ್ಮ ಕಾಲುಗಳನ್ನು ಮುಂದಿಡಿ ಮತ್ತು ಅದನ್ನು ನೆಲದಿಂದ ಮೇಲಕ್ಕೆತ್ತಿ. ವಲಯಗಳಲ್ಲಿ ನಿಮ್ಮ ಕಾಲುಗಳನ್ನು ಪ್ರದಕ್ಷಿಣಾಕಾರವಾಗಿ ಸರಿಸಿ.",
  'ex_desc_245': "ನಿಮ್ಮ ಕಾಲುಗಳನ್ನು ಒಟ್ಟಿಗೆ ಬಾಗಿಸಿ ಮತ್ತು ನಿಮ್ಮ ದೇಹವನ್ನು ಬೆಂಬಲಿಸಲು ನಿಮ್ಮ ಕೈಗಳನ್ನು ನಿಮ್ಮ ಭುಜಗಳ ಕೆಳಗೆ ನೆಲದ ಮೇಲೆ ಕುಳಿತುಕೊಳ್ಳಿ. ನಂತರ ನಿಮ್ಮ ಸೊಂಟವನ್ನು ನಿಮಗೆ ಸಾಧ್ಯವಾದಷ್ಟು ಎತ್ತರಕ್ಕೆ ಎತ್ತುವಾಗ ಒಂದು ಕಾಲು ಮೇಲಕ್ಕೆತ್ತಿ. ಇತರ ಕಾಲಿಗೆ ಬದಲಾಯಿಸಿ ಮತ್ತು ಪುನರಾವರ್ತಿಸಿ. ನಿಮ್ಮ ಬೆನ್ನಿನ ಬದಲು ನಿಮ್ಮ ಸೊಂಟದಿಂದ ನಿಮ್ಮನ್ನು ಮೇಲಕ್ಕೆ ತಳ್ಳಿರಿ. ಇದು ಗ್ಲುಟಿಯಸ್‌ಗೆ ಉತ್ತಮ ವ್ಯಾಯಾಮವಾಗಿದೆ.",
  'ex_desc_246': "ನಿಮ್ಮ ತೋಳುಗಳನ್ನು ನೇರವಾಗಿ ಮೇಲಕ್ಕೆ ವಿಸ್ತರಿಸಿ ನಿಮ್ಮ ಹೊಟ್ಟೆಯ ಮೇಲೆ ಮಲಗಿಕೊಳ್ಳಿ. ನಿಮ್ಮ ವಿರುದ್ಧ ಎಸ್‌ಆರ್‌ಎಂ ಮತ್ತು ಕಾಲು ಪರ್ಯಾಯವಾಗಿ ಮೇಲಕ್ಕೆತ್ತಿ.",
  'ex_desc_247': "ಕುಳಿತು ನಿಮ್ಮ ಕಾಲುಗಳನ್ನು ಚಾಪೆಯ ಮೇಲೆ ದಾಟಿಸಿ. ನಿಮ್ಮ ಎಡಗೈಯನ್ನು ನಿಮ್ಮ ಬಲ ಮೊಣಕಾಲಿನ ಮೇಲೆ ಮತ್ತು ನಿಮ್ಮ ಬಲಗೈ ನಿಮ್ಮ ಹಿಂದೆ ನೆಲದ ಮೇಲೆ ಇರಿಸಿ.",
  'ex_desc_248': "ಕುಳಿತು ನಿಮ್ಮ ಕಾಲುಗಳನ್ನು ಚಾಪೆಯ ಮೇಲೆ ದಾಟಿಸಿ. ನಿಮ್ಮ ಬಲಗೈಯನ್ನು ನಿಮ್ಮ ಎಡ ಮೊಣಕಾಲಿನ ಮೇಲೆ ಮತ್ತು ನಿಮ್ಮ ಎಡಗೈ ನಿಮ್ಮ ಹಿಂದೆ ನೆಲದ ಮೇಲೆ ಇರಿಸಿ. ನಿಧಾನವಾಗಿ ನಿಮ್ಮ ಮೇಲಿನ ದೇಹವನ್ನು ಎಡಕ್ಕೆ ತಿರುಗಿಸಿ. ಅದನ್ನು ಕೆಲವು ಸೆಕೆಂಡುಗಳ ಕಾಲ ಹಿಡಿದುಕೊಳ್ಳಿ.",

