  'plan_introduction_2': "ನಿಮ್ಮ ಬಟ್ ಅನ್ನು ಬಿಗಿಗೊಳಿಸಲು ಮತ್ತು ಎತ್ತುವಂತೆ 5-15 ನಿಮಿಷ ಸರಳ ಜೀವನಕ್ರಮಗಳು. ಯಾವುದೇ ಸಮಯದಲ್ಲಿ ಉತ್ತಮ ಆಕಾರದ ಬಟ್ ಪಡೆಯಿರಿ!",
  'plan_introduction_3': "ಹೊಟ್ಟೆಯ ಕೊಬ್ಬನ್ನು ಕಳೆದುಕೊಳ್ಳಿ ಮತ್ತು ಮನೆಯಲ್ಲಿ ನಮ್ಮ ಸಣ್ಣ ಮತ್ತು ಪರಿಣಾಮಕಾರಿ ಜೀವನಕ್ರಮಗಳೊಂದಿಗೆ ನಿಮ್ಮ ಹೊಟ್ಟೆಯನ್ನು ಚಪ್ಪಟೆ ಮಾಡಿ! ಕೆಲವೇ ವಾರಗಳಲ್ಲಿ ನೀವು ಸಮತಟ್ಟಾದ ಹೊಟ್ಟೆಯನ್ನು ಪಡೆಯುತ್ತೀರಿ!",
  'plan_introduction_4': "ಈ ಜೀವನಕ್ರಮಗಳು ಸ್ನಾಯುಗಳನ್ನು ನಿರ್ಮಿಸಲು ಮತ್ತು ಶಕ್ತಿಯನ್ನು ಸುಧಾರಿಸಲು ಸಹಾಯ ಮಾಡುತ್ತದೆ ಎಂದು ಸಾಬೀತಾಗಿದೆ. ಯಾವುದೇ ಉಪಕರಣಗಳ ಅಗತ್ಯವಿಲ್ಲ, ನೀವು ಶೀಘ್ರದಲ್ಲೇ ಫಲಿತಾಂಶಗಳನ್ನು ನೋಡುತ್ತೀರಿ!",

  'plan_test_desc_1': "ಕಾಲುಗಳನ್ನು ನೇರಗೊಳಿಸಿದಾಗ ಮತ್ತು ಮೊಣಕಾಲುಗಳು ಒಟ್ಟಿಗೆ ಇರುವಾಗ ಕಣಕಾಲುಗಳ ನಡುವಿನ ಅಂತರವು 1.5 ಸೆಂ.ಮೀ ಗಿಂತ ಹೆಚ್ಚಿರುತ್ತದೆ.\n\nknock-meee OS ಒಂದು ಸ್ಥಿತಿಯಲ್ಲಿ ಮೊಣಕಾಲುಗಳು ಕೋನದಲ್ಲಿರುತ್ತವೆ ಮತ್ತು ಕಾಲುಗಳನ್ನು ನೇರಗೊಳಿಸಿದಾಗ ಪರಸ್ಪರ ಸ್ಪರ್ಶಿಸುತ್ತವೆ.",
  'plan_test_desc_2': "ನಿಮ್ಮ ಪಾದಗಳು ಒಟ್ಟಿಗೆ ಇರುವಾಗ ನಿಮ್ಮ ಮೊಣಕಾಲುಗಳ ನಡುವಿನ ಅಂತರವು 3 ಸೆಂ.ಮೀ ಗಿಂತ ಹೆಚ್ಚಾಗಿದೆ.\n\nboblegs ಅನ್ನು ಮೊಣಕಾಲಿನ ಮೇಲೆ ಹೊರಗಿನ ಬಾಗಿಸುವ ಮೂಲಕ ಗುರುತಿಸಲಾಗುತ್ತದೆ, ಅಂದರೆ ತೊಡೆಯ ಅಕ್ಷಕ್ಕೆ ಸಂಬಂಧಿಸಿದಂತೆ ಕೆಳಗಿನ ಕಾಲು ಒಳಮುಖವಾಗಿ ಕೋನಗೊಳ್ಳುತ್ತದೆ, ಒಟ್ಟಾರೆ ಅಂಗವನ್ನು ನೀಡುತ್ತದೆ ಬಿಲ್ಲುಗಾರನ ಬಿಲ್ಲಿನ ನೋಟ.",

  'plan_short_desc_5': "ಈ ಅಧಿವೇಶನದಲ್ಲಿ ಜೀವನಕ್ರಮಗಳು ನಿಮ್ಮ ದೇಹದ ಪ್ರತಿಯೊಂದು ಸ್ನಾಯುಗಳನ್ನು ತೊಡಗಿಸುತ್ತವೆ, ನಿಮ್ಮ ವ್ಯಾಯಾಮದ ಫಲಿತಾಂಶವನ್ನು ಗರಿಷ್ಠಗೊಳಿಸಿ ಮತ್ತು ನಿಮ್ಮ ಒಟ್ಟಾರೆ ಫಿಟ್‌ನೆಸ್ ಅನ್ನು ಸುಧಾರಿಸುತ್ತದೆ.",
  'plan_short_desc_6': "ಎಲ್ಲಾ ಕೋನಗಳಿಂದ ನಿಮ್ಮ ಬಟ್ ಮತ್ತು ಕಾಲುಗಳನ್ನು ಗುರಿಯಾಗಿಸಿ, ನೀವು ಯೋಚಿಸುವುದಕ್ಕಿಂತ ವೇಗವಾಗಿ ಉತ್ತಮವಾದ ಆಕಾರದ ಕೊಳ್ಳೆ ಮತ್ತು ತೆಳ್ಳಗಿನ ಕಾಲುಗಳನ್ನು ಪಡೆಯಲು ಸಹಾಯ ಮಾಡುತ್ತದೆ!",
  'plan_short_desc_7': "ಗೋಚರಿಸುವ ಸುಂದರವಾದ ಎಬಿಎಸ್ ಅನ್ನು ಬಯಸುವವರಿಗೆ. ಆರಂಭಿಕ ಮತ್ತು ತಾಲೀಮು ಯೋಧರಿಗೆ ಸೂಕ್ತವಾಗಿದೆ.",
  'plan_short_desc_8': "ತ್ವರಿತ ತೋಳಿನ ಕೊಬ್ಬಿನ ಸುಡುವಿಕೆ! ನಿಮ್ಮ ದೇಹದ ತೂಕದಿಂದ ಸ್ಲಿಮ್ ಮತ್ತು ನಿಮ್ಮ ತೋಳುಗಳನ್ನು ಕೆತ್ತಿಸಿ!",
  'plan_short_desc_9': "ಶಕ್ತಿಯೊಂದಿಗೆ ಎಚ್ಚರಗೊಳ್ಳಿ, ನಿಮ್ಮ ದೇಹವನ್ನು ದಿನಕ್ಕೆ ಆದ್ಯತೆ ನೀಡಿ.",
  'plan_short_desc_10': "ನೀವೇ ವಿಶ್ರಾಂತಿ ಪಡೆಯಿರಿ ಮತ್ತು ಉತ್ತಮ-ಗುಣಮಟ್ಟದ ನಿದ್ರೆ ಪಡೆಯಿರಿ.",
  'plan_short_desc_11': "7 ನಿಮಿಷದ ತಾಲೀಮು ವಿಶೇಷವಾಗಿ ಮಹಿಳೆಯರಿಗೆ ವಕ್ರಾಕೃತಿಗಳನ್ನು ಪಡೆಯಲು ಸಹಾಯ ಮಾಡುತ್ತದೆ. ಈ ತಾಲೀಮು ನಿಮ್ಮ ಬಟ್, ಹೊಟ್ಟೆ, ಕಾಲುಗಳು ಇತ್ಯಾದಿಗಳನ್ನು ಆವರಿಸುತ್ತದೆ.",
  'plan_short_desc_12': "ಹೆಚ್ಚು ಪರಿಣಾಮಕಾರಿ ಪೂರ್ಣ ದೇಹದ ಜೀವನಕ್ರಮಗಳು! ಸಮತಟ್ಟಾದ ಹೊಟ್ಟೆ, ರೌಂಡರ್ ಕೊಳ್ಳೆ ಮತ್ತು ಸ್ವರದ \nnlegs ನೊಂದಿಗೆ \nnmore ಆಕರ್ಷಕ ದೇಹವನ್ನು ಪಡೆಯಲು ದಿನಕ್ಕೆ ಕೇವಲ 7 ನಿಮಿಷ ತೆಗೆದುಕೊಳ್ಳಿ.",
  'plan_short_desc_13': "ಸ್ನಾಯುಗಳನ್ನು ಸಡಿಲಗೊಳಿಸಿ ಮತ್ತು ನೋವುಗಳನ್ನು ಕಡಿಮೆ ಮಾಡಿ",
  'plan_short_desc_14': "ತೂಕ ನಷ್ಟಕ್ಕೆ ಪರಿಣಾಮಕಾರಿಯಾದ ತೀವ್ರವಾದ ತಾಲೀಮು ಸಪ್ಪರ್ ಮಾಡಿ. ನೀವು ದಿನವಿಡೀ ಕ್ಯಾಲೊರಿಗಳನ್ನು ಸುಡಬಹುದು!",
  'plan_short_desc_15': "ಎಸಿಎಸ್ಎಂ ಸಂಶೋಧನೆಯ ಆಧಾರದ ಮೇಲೆ ವಿನ್ಯಾಸಗೊಳಿಸಲಾಗಿದೆ, ಫಿಟ್ನೆಸ್ ಮತ್ತು ಆರೋಗ್ಯವನ್ನು ಸುಧಾರಿಸುತ್ತದೆ ಎಂದು ಸಾಬೀತಾಗಿದೆ.",
  'plan_short_desc_16': "ಕೊಬ್ಬು ಸುಡುವಿಕೆಗೆ ಅತ್ಯಂತ ಪರಿಣಾಮಕಾರಿ ತಾಲೀಮು. ಹೆಚ್ಚಿನ ತೀವ್ರತೆ \nnworkouts 30 ನಿಮಿಷದ ನಂತರ ಚಯಾಪಚಯ ದರವನ್ನು ದ್ವಿಗುಣಗೊಳಿಸುತ್ತದೆ! ಕೇವಲ 4 \nnmin, ಯಾವುದೇ ಕ್ಷಮಿಸಿಲ್ಲ!",
  'plan_short_desc_17': "ನಿಮ್ಮ ಪೂರ್ಣ ದೇಹಕ್ಕಾಗಿ ಈ ಹೆಚ್ಚಿನ-ತೀವ್ರತೆಯ ತಾಲೀಮು, \nನೈರೋಬಿಕ್ ವ್ಯಾಯಾಮದೊಂದಿಗೆ ಸಂಯೋಜಿಸಲ್ಪಟ್ಟಿದೆ, ವಿಕ್ಟೋರಿಯಾಸ್ ಸೀಕ್ರೆಟ್ \nnmodel ನಂತೆ ಆಕಾರವನ್ನು ಪಡೆಯಲು ನಿಮಗೆ ಸಹಾಯ ಮಾಡುತ್ತದೆ!",
  'plan_short_desc_18': "ಕೇವಲ 10 ನಿಮಿಷದಲ್ಲಿ 100 ಕ್ಯಾಲ್ ಅನ್ನು ಸುಟ್ಟು! ಹೆಚ್ಚಿನ ತೀವ್ರವಾದ ತಾಲೀಮುನೊಂದಿಗೆ ದಕ್ಷತೆಯನ್ನು ಗರಿಷ್ಠಗೊಳಿಸಿ.",
  'plan_short_desc_19': "ತ್ವರಿತ ಮತ್ತು ಪರಿಣಾಮಕಾರಿ. ಕೇವಲ 1 0 ನಿಮಿಷ ಕ್ಯಾಲೋರಿ ಬರ್ನ್ ಅನ್ನು ಗರಿಷ್ಠಗೊಳಿಸಿ \nನಾಂಡ್ ಈ ಹೆಚ್ಚಿನ ತೀವ್ರತೆಯ ತಾಲೀಮು ನಿಮ್ಮ ಪೂರ್ಣ ದೇಹವನ್ನು ತರಬೇತಿ ಮಾಡಿ.",
  'plan_short_desc_20': "ಅಲ್ಟಿಮೇಟ್ ಹೆಚ್ಚಿನ ತೀವ್ರತೆಯ ಜೀವನಕ್ರಮಗಳು ನಿಮ್ಮನ್ನು ಇನ್ನಷ್ಟು ಸುಡುವಂತೆ ಮಾಡುತ್ತದೆ! ಅನುಭವಿ ತಾಲೀಮು \nnwarriors ಗಾಗಿ ಕ್ರೂರ ಕೊಬ್ಬು ಸುಡುವ ತರಬೇತಿ.",
  'plan_short_desc_21': "ನಿಮ್ಮ ಕೊಳ್ಳೆಯನ್ನು ಗುರಿಯಾಗಿಸಿ, ನಿಮ್ಮ ಮಾದಕ ವಕ್ರಾಕೃತಿಗಳನ್ನು ಗರಿಷ್ಠಗೊಳಿಸಲು ತೊಡೆಯ ಟೋನಿಂಗ್ ತಾಲೀಮು ಸೇರಿಸಿ.",
  'plan_short_desc_22': "ಜಂಪಿಂಗ್ ಇಲ್ಲ! ನಿಮ್ಮ \nnlegs ಅನ್ನು ರೂಪಿಸಲು ಕಡಿಮೆ ಪ್ರಭಾವದ ತಾಲೀಮು. ಯಾವುದೇ ಶಬ್ದ ಮತ್ತು ಅಪಾರ್ಟ್ಮೆಂಟ್ ಸ್ನೇಹಿ ಇಲ್ಲ.",
  'plan_short_desc_23': "ಬ್ರೆಜಿಲಿಯನ್ ಬಟ್ ಇನ್ನು ಮುಂದೆ ಕನಸು ಅಲ್ಲ! ಸೆಕ್ಸಿಯರ್, ರೌಂಡರ್ ಮತ್ತು ದೊಡ್ಡ ಕೊಳ್ಳೆ ಪಡೆಯಲು ನಿಮ್ಮ ಬಟ್ ಅನ್ನು ಎಲ್ಲಾ ಕೋನಗಳನ್ನು ಉತ್ತೇಜಿಸಿ.",
  'plan_short_desc_24': "ಕೇವಲ 3 ನಿಮಿಷ ತ್ವರಿತ ತಾಲೀಮು! ನಿಮ್ಮ ment \nncrazy-busy ವೇಳಾಪಟ್ಟಿಯ ಹೊರತಾಗಿಯೂ ಸುಂದರವಾದ ಬಟ್ ಅನ್ನು ಸ್ಕೋರ್ ಮಾಡಿ, ನಿಮ್ಮ ment ಿದ್ರ ಸಮಯವನ್ನು ಬಳಸಿಕೊಂಡು!",
  'plan_short_desc_25': "ತೊಡೆಯ ಅಂತರ ಬೇಕೇ? ಉದ್ದೇಶಿತ ಜೀವನಕ್ರಮಗಳು ಒಳ ತೊಡೆಯ ಕೊಬ್ಬನ್ನು ಸುಡಲು ಸಹಾಯ ಮಾಡುತ್ತದೆ. ಹರಿಕಾರ ಸ್ನೇಹಿ!",
  'plan_short_desc_26': "ನಿಮ್ಮ ತೊಡೆಯ ಕೊಬ್ಬಿನ ಮೇಲೆ ಕೇಂದ್ರೀಕರಿಸಿ, ಉತ್ತಮ ತಾಲೀಮು ಕಾಲುಗಳನ್ನು ಮತ್ತು ಬಟ್ ಅನ್ನು ಬಿಗಿಗೊಳಿಸಲು ಸಹಾಯ ಮಾಡುತ್ತದೆ. ನಿಮಗೆ ಬಿಕಿನಿ ಸಿದ್ಧರಾಗಿ!",
  'plan_short_desc_27': "7 ನಿಮಿಷದಲ್ಲಿ ತೊಡೆಯ ಕೊಬ್ಬನ್ನು ಸುಟ್ಟುಹಾಕಿ. ಕಡಿಮೆ ಪ್ರಭಾವದ ತಾಲೀಮು ಎಲ್ಲರಿಗೂ, ದುರ್ಬಲ ಮೊಣಕಾಲುಗಳನ್ನು ಹೊಂದಿರುವ ಜನರಿಗೆ ಸಹ.",
  'plan_short_desc_28': "ತೀವ್ರವಾದ ತಾಲೀಮು ಒಳಗಿನ ತೊಡೆಯ ಕೊಬ್ಬನ್ನು ಸುಡುವುದನ್ನು ಗರಿಷ್ಠಗೊಳಿಸಿ. ಬೃಹತ್ ಸ್ನಾಯುಗಳಿಲ್ಲ!",
  'plan_short_desc_29': "7 ನಿಮಿಷ ತ್ವರಿತ ಕೊಳ್ಳೆ ತಾಲೀಮು. ನಿಮ್ಮ ಪೃಷ್ಠವನ್ನು ಕಡಿಮೆ ಸಮಯದಲ್ಲಿ ಬಿಗಿಗೊಳಿಸಿ!",
  'plan_short_desc_30': "ಹೆಚ್ಚಿನ ತೀವ್ರತೆಯ ಜೀವನಕ್ರಮಗಳು ನಿಮ್ಮ ಬಟ್ ಸುಡುವಿಕೆಯನ್ನು ಅನುಭವಿಸುವಂತೆ ಮಾಡುತ್ತದೆ. ನಿಮ್ಮ ಬಟ್ನ ವಕ್ರತೆಯನ್ನು ಅತ್ಯಂತ ಪರಿಣಾಮಕಾರಿ ರೀತಿಯಲ್ಲಿ ಹೆಚ್ಚಿಸಿ.",
  'plan_short_desc_31': "ವಿಶ್ರಾಂತಿ ಮತ್ತು ನಮ್ಯತೆಯನ್ನು ಬೆಳೆಸಲು ನಿಮಗೆ ಸಹಾಯ ಮಾಡುತ್ತದೆ. ಚಾಲನೆಯಲ್ಲಿರುವ ಮತ್ತು ವ್ಯಾಯಾಮ ಮಾಡಲು ಇದು ಉತ್ತಮ ಹಿಗ್ಗಿಸುವ ದಿನಚರಿಯಾಗಿದೆ.",
  'plan_short_desc_32': "ವಿಶ್ರಾಂತಿ ಮತ್ತು ನಮ್ಯತೆಯನ್ನು ಬೆಳೆಸಲು ನಿಮಗೆ ಸಹಾಯ ಮಾಡುತ್ತದೆ. ಚಾಲನೆಯಲ್ಲಿರುವ ಮತ್ತು ವ್ಯಾಯಾಮ ಮಾಡಲು ಇದು ಉತ್ತಮ ಹಿಗ್ಗಿಸುವ ದಿನಚರಿಯಾಗಿದೆ.",
  'plan_short_desc_33': "ನೋವನ್ನು ನಿವಾರಿಸಿ ಮತ್ತು ದುರ್ಬಲ ಮೊಣಕಾಲುಗಳನ್ನು ಬಲಪಡಿಸಿ",
  'plan_short_desc_34': "ಕೇವಲ ಫೋಮ್ ರೋಲರ್ನೊಂದಿಗೆ ಮೊಣಕಾಲು ನೋವನ್ನು ಪರಿಣಾಮಕಾರಿಯಾಗಿ ಸುತ್ತಿಕೊಳ್ಳಿ",
